/* Updating ranklist for some rating and sold values */

/* Creating View so that we can update Avg_rating in ranklist whenever a rating is given for a book */
DROP VIEW IF EXISTS temp;
CREATE VIEW temp as SELECT C1.ISBN, (AVG(C_Rating)+AVG(Cr_rating))/2 as rating FROM Cust_review C1, Critic_review C2
WHERE C1.ISBN = C2.ISBN
GROUP BY C1.ISBN;

/* Making a Procedure to manage the avg_rating of a book given by the critic and the customer */
DELIMITER //

CREATE PROCEDURE update_avg_rating_Ranklist()
BEGIN
	UPDATE ranklist r
		INNER JOIN temp A
		ON r.ISBN = A.ISBN
	SET
		Avg_rating = ROUND(A.Rating, 4)
	WHERE r.ISBN = A.ISBN;
END //

DELIMITER ;

/* Making a procedure to assign a rank to each book in the table ranklist */
DELIMITER //

CREATE PROCEDURE assign_rank_Ranklist()
BEGIN
	SET @r = 0;
	UPDATE Ranklist SET B_rank = @r:= (@r+1)
	ORDER BY Avg_rating DESC, sold DESC;
END //

DELIMITER ;

/* To Calculate the Avg_rating of books in the table Ranklist */
CALL update_avg_rating_Ranklist();

/* Updating ranklist table with relevant sold value according to rating */
UPDATE ranklist SET sold = FLOOR(1 + RAND()*80) WHERE Avg_rating BETWEEN 1 AND 2;
UPDATE ranklist SET sold = FLOOR(100 + RAND()*151) WHERE Avg_rating>2 AND Avg_rating<=5;
UPDATE ranklist SET sold = FLOOR(250 + RAND()*251) WHERE Avg_rating>5 AND Avg_rating<=7;
UPDATE ranklist SET sold = FLOOR(500 + RAND()*1001) WHERE Avg_rating>7 AND Avg_rating<=10;

/* To rank the books according to avg_rating and sold both Descending */
CALL assign_rank_Ranklist();

