/*Trigger for inserting book into ranklist and setting new rank to books based on (Avg_rating, sold)
whenever a book is inserted in book table.*/

DROP TRIGGER IF EXISTS `book_ranklist_insert`;

DELIMITER $$
USE `bookstore1`
$$
CREATE 
DEFINER=`root`@`localhost` 
TRIGGER `bookstore1`.`book_ranklist_insert` 
AFTER INSERT ON `bookstore1`.`book`
FOR EACH ROW
-- Edit trigger body code below this line. Do not edit lines above this one
BEGIN 
	SET @newrank = (SELECT MAX(B_rank) from Ranklist)+1;
	VALUES(@newrank, NEW.ISBN, NEW.genre, '0.0', 0);

	CALL assign_rank_Ranklist();
END$$

/*Trigger for setting new rank to books based on (Avg_rating, sold)
