/* Trigger for Updating sold, quantity whenever a book is added to cart_object */

DROP TRIGGER IF EXISTS `Update_sold_quantity_count`;

DELIMITER $$
USE `bookstore1`
$$
CREATE 
DEFINER=`root`@`localhost` 
TRIGGER `bookstore1`.`Update_sold_quantity_count` 
AFTER INSERT ON `bookstore1`.`cart_object`
FOR EACH ROW
-- Edit trigger body code below this line. Do not edit lines above this one
BEGIN 
UPDATE book SET quantity = quantity - NEW.count WHERE ISBN = NEW.ISBN;
UPDATE ranklist SET sold = sold + NEW.count WHERE ISBN = NEW.ISBN;
CALL assign_rank_Ranklist();
END$$


